function FriendCard() {
    return (
        <div className="card">
            <div className="img-container">
                <img
                    alt="character"
                    src={image}
                />
            </div>
            <div className="content">
                <ul>
                    <li>
                        <strong>Name:</strong> {name}
                    </li>
                    <li>
                        <strong>Occupation:</strong> {occupation}
                    </li>
                    <li>
                        <strong>Location:</strong> {location}
                    </li>
                </ul>
            </div>
        </div>
    );
}

export default FriendCard;
